import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import NewsletterSubscribe from '../components/NewsletterSubscribe';

const Home = () => {
  const [expandedCards, setExpandedCards] = useState({
    card1: false,
    card2: false,
    card3: false,
  });

  const toggleCard = (cardId) => {
    setExpandedCards((prev) => ({
      ...prev,
      [cardId]: !prev[cardId],
    }));
  };

  return (
    <div
      className="container mx-auto px-4 py-8"
      style={{
        backgroundImage: 'url("/images/home-bg.jpg")',
        backgroundSize: 'cover',
        backgroundPosition: 'center',
        backgroundAttachment: 'fixed',
      }}
    >
      <div className="text-center mb-12">
        <h1 className="text-4xl font-bold text-purple-800 mb-4">Swasthyashe</h1>
        <p className="text-xl text-gray-600">
          Empowering Women's Health Through Traditional Wisdom and Modern Science
        </p>
      </div>

      <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-8 mb-12">
        {/* Ancient Wisdom Card */}
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-2xl font-semibold text-purple-700 mb-4">Ancient Wisdom</h2>
          <div className={expandedCards.card1 ? '' : 'line-clamp-3'}>
            🌿 Ancient Wisdom: Nurturing Women's Well-being
            <br /><br />
            For generations, Indian traditions have embraced the power of nature and holistic living to support women's health and well-being. Rooted in the ancient sciences of <strong>Ayurveda, yoga, and natural remedies</strong>, these practices offer gentle, effective ways to navigate every stage of womanhood.
            <br /><br />
            From soothing <strong>herbal remedies</strong> for period pain to mindful rituals that promote balance and inner strength, these traditions remind us that true wellness comes from honoring the <strong>body, mind, and soul</strong>.
          </div>
          <button onClick={() => toggleCard('card1')} className="mt-4 text-purple-600 hover:text-purple-800">
            {expandedCards.card1 ? 'Read Less' : 'Read More'}
          </button>
        </div>

        {/* Modern Science Card */}
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-2xl font-semibold text-purple-700 mb-4">Modern Science</h2>
          <div className={expandedCards.card2 ? '' : 'line-clamp-3'}>
            🔬 Modern Science: Bridging Tradition and Innovation
            <br /><br />
            Modern science is now validating and enhancing time-tested traditions. Research reveals how <strong>natural remedies, mindful rituals, and holistic lifestyles</strong> contribute to optimal health—from hormonal balance to mental well-being.
            <br /><br />
            Studies confirm the benefits of practices like <strong>yoga for stress relief</strong>, <strong>Ayurvedic herbs for hormonal health</strong>, and traditional diets for better digestion and immunity.
          </div>
          <button onClick={() => toggleCard('card2')} className="mt-4 text-purple-600 hover:text-purple-800">
            {expandedCards.card2 ? 'Read Less' : 'Read More'}
          </button>
        </div>

        {/* Holistic Approach Card */}
        <div className="bg-white p-6 rounded-lg shadow-md">
          <h2 className="text-2xl font-semibold text-purple-700 mb-4">Holistic Approach</h2>
          <div className={expandedCards.card3 ? '' : 'line-clamp-3'}>
            🌸 Holistic Approach: Balance for Body, Mind & Spirit
            <br /><br />
            A holistic approach combines <strong>nutrition, movement, mindfulness, and self-care</strong> to promote overall wellness. By integrating ancient traditions and modern science, women can cultivate a lifestyle that supports <strong>physical strength, emotional balance, and inner peace</strong>.
            <br /><br />
            Whether through <strong>nutritious foods, yoga, meditation, or self-care rituals</strong>, every aspect of health is nurtured.
          </div>
          <button onClick={() => toggleCard('card3')} className="mt-4 text-purple-600 hover:text-purple-800">
            {expandedCards.card3 ? 'Read Less' : 'Read More'}
          </button>
        </div>
      </div>

      <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-8 mb-12">
        {[
          { title: 'Period Health', description: 'Natural remedies and holistic approaches to menstrual wellness.', path: '/period-health' },
          { title: 'Mental Wellness', description: 'Traditional practices for emotional balance and mental harmony.', path: '/mental-wellness' },
          { title: 'Sexual & Reproductive Health', description: 'Essential information for reproductive well-being.', path: '/sexual-health' },
          { title: 'Skin & Hair Care', description: 'Natural beauty secrets from Ayurvedic traditions.', path: '/skin-hair-care' },
          { title: 'Pregnancy Care', description: 'Holistic support throughout your pregnancy journey.', path: '/pregnancy-care' },
        ].map((topic) => (
          <Link
            key={topic.path}
            to={topic.path}
            className="bg-white p-6 rounded-lg shadow-md hover:shadow-lg transition-shadow"
          >
            <h2 className="text-2xl font-semibold text-purple-700 mb-4">{topic.title}</h2>
            <p className="text-gray-600">{topic.description}</p>
          </Link>
        ))}
      </div>

      <div className="max-w-xl mx-auto">
        <NewsletterSubscribe />
      </div>
    </div>
  );
};

export default Home;
